import React from 'react';
import {Link, Route, Routes} from 'react-router-dom';

function Header() {
    return (
      <header className="header">
        <div className="header__logo"></div>
        <Routes>
          <Route path='singin'>
            <Link to='signup' className='header__link'></Link>
          </Route>
          <Route path='singup'>

          </Route>
        </Routes>
      </header>
    )
}

export default Header;
